import { Container, Segment, Form, TextArea } from 'semantic-ui-react';
 import Head from 'next/head';
 import Header from './Header';
//import './DottedBox.css';
import '../Css/general.css';

class landingPage extends React.Component{
	render(){

		return(
			<Container style={{width:'1230px'}}>
			  <Header/>

			    <Segment>
					 <h1> QUIKK Smart Contract Auditor</h1>
					 <h4> A light, open-source smart contract auditor for solidity contracts</h4>
					 <Form>
					 <TextArea className = "textbox1"/>
					 </Form>
				 </Segment>

		  </Container>
		  )

	}
}

export default landingPage;
